"""
1. Отсортируйте по убыванию методом "пузырька" одномерный целочисленный массив,
заданный случайными числами на промежутке [-100; 100). Выведите на экран
исходный и отсортированный массивы. Сортировка должна быть реализована в
виде функции. Обязательно доработайте алгоритм (сделайте его умнее).

Идея доработки: если за проход по списку не совершается ни одной сортировки,
то завершение
Обязательно сделайте замеры времени обеих реализаций
и обосновать дала ли оптимизация эффективность

Подсказка: обратите внимание, сортируем не по возрастанию, как в примере,
а по убыванию
"""
import time
import random

initial_array = list(random.uniform(-100, 100) for _ in range(0, 4000))


def bench(decor_func):
    def wrapper(*args, **kwargs):
        start = time.time()
        __result = decor_func(*args, **kwargs)
        end = time.time()
        print(f'Время исполнения: {end - start}')
        return __result
    return wrapper


@bench
def bubble_sort(sorting_array):
    __sorted_array = sorting_array.copy()
    for i in range(0, len(__sorted_array)-1):
        for j in range(0, len(__sorted_array)-1-i):
            if __sorted_array[j] < __sorted_array[j+1]:
                __sorted_array[j], __sorted_array[j+1] = __sorted_array[j+1], __sorted_array[j]
    return __sorted_array


@bench
def optimized_bubble_sort(sorting_array):
    __sorted_array = sorting_array.copy()
    for i in range(0, len(__sorted_array)-1):
        __counter = 0
        for j in range(0, len(__sorted_array)-1-i):
            if __sorted_array[j] < __sorted_array[j+1]:
                __counter += 1
                __sorted_array[j], __sorted_array[j+1] = __sorted_array[j+1], __sorted_array[j]
        if __counter <= 1:
            print('early close', i)
            return __sorted_array
    return __sorted_array


print(initial_array)
print(bubble_sort(initial_array))
print(optimized_bubble_sort(initial_array))

